"""# **Text Preproccesing**

Text Processing is an essential task in NLP as it helps to clean and transform raw data into a suitable format used for analysis or modeling.Some crucial methods commonly used are follows-

##1. **Tokenization**

Tokenization is one of the first step in any NLP pipeline. Tokenization is nothing but splitting the raw text into small chunks of words or sentences, called tokens. If the text is split into words, then its called as 'Word Tokenization' and if it's split into sentences then its called as 'Sentence Tokenization'.
"""

paragraph = """Apple Inc. (AAPL) reported a strong performance in the second quarter, exceeding market expectations with a revenue of $89.6 billion,
up 54% year-over-year. The company's net income surged to $23.6 billion, driven by robust sales of iPhone 12 and significant growth in services and
wearables segments. CEO Tim Cook attributed this success to the company's continued innovation and customer loyalty.
Despite global supply chain challenges, Apple maintained its guidance for the upcoming quarter, forecasting revenue between
$85 billion and $90 billion. Following the earnings report, Apple's stock price increased by 3% in after-hours trading.
"""

from nltk.tokenize import sent_tokenize
sentences = sent_tokenize(paragraph)

for i, sentence in enumerate(sentences, 1):
    print(f"{i}. {sentence}")

from nltk.tokenize import word_tokenize
words = word_tokenize(paragraph)

print(words)

from nltk.tokenize import wordpunct_tokenize
