print(words)

"""##2. **Stemming**

Stemming is a method in text processing that eliminates prefixes and suffixes from words, transforming them into their fundamental or root form.

 NLTK contains a variety of stemming algorithms-


*   Porterâ€™s Stemmer
*   Snowball Stemmer
*   Regexp Stemmer etc


"""

words=["eating","eats","eaten","writing","writes","programming","programs","history","finally","finalized","fairly"]

from nltk.stem import PorterStemmer
stemming = PorterStemmer()

for word in words:
    print(word+"--->"+stemming.stem(word))

from nltk.stem import RegexpStemmer
stemming = RegexpStemmer('ing$|en$|able$|s$',min=4)

for word in words:
    print(word+"--->"+stemming.stem(word))

from nltk.stem import SnowballStemmer
stemming = SnowballStemmer('english')

for word in words:
    print(word+"--->"+stemming.stem(word))

"""##3. **Lemmatization**

The output we will get after lemmatization is called 'lemma', which is a root word rather than root stem, the output of stemming. After lemmatization,
we will be getting a valid word that means the same thing. NLTK provides WordNetLemmatizer class which is a thin wrapper around the wordnet corpus.
"""

from nltk.stem import WordNetLemmatizer
lemmatizer = WordNetLemmatizer()

for word in words:
    print(word+"--->"+lemmatizer.lemmatize(word))

"""POS(Part of Speech) Tagging is the process of labeling words in a text with their corresponding parts of speech (e.g., noun, verb, adjective).



*   Noun - n
*   Verb - v
*   Adjective - a
*   Adverb - r



"""

from nltk.stem import WordNetLemmatizer
lemmatizer = WordNetLemmatizer()

for word in words:
    print(word+"--->"+lemmatizer.lemmatize(word,pos="a"))

"""##4. **Stop Words**"""

