"""# **Word Embeddings**

Word Embedding is an approach for representing words and documents. Word Embedding or Word Vector is a numeric vector input that represents a word in a lower-dimensional space. It allows words with similar meanings to have a similar representation.

* Based on Count

* Neural Approach- Supervised Learning

##1. **One Hot Encoding**
"""

corpus = [
    "The quick brown fox jumped over the lazy dog.",
    "She sells seashells by the seashore.",
    "Peter Piper picked a peck of pickled peppers."
]

unique_words = set()
for sentence in corpus:
    for word in sentence.split():
        unique_words.add(word.lower())
unique_words

word_to_index = {}
for i, word in enumerate(unique_words):
    word_to_index[word] = i
word_to_index

one_hot_vectors = []
for sentence in corpus:
    sentence_vectors = []
    for word in sentence.split():
        vector = np.zeros(len(unique_words))
        vector[word_to_index[word.lower()]] = 1
        sentence_vectors.append(vector)
    one_hot_vectors.append(sentence_vectors)

print("One-hot encoded vectors for the first sentence:")
for vector in one_hot_vectors[1]:
    print(vector)

"""##2. **Bag of Words(BoW)**"""

corpus = [
    "Cats are great pets",
    "Dogs are Cats are animals",
    "Dogs bring joy to people"
]

for i in range(len(corpus)):
    corpus[i] = corpus[i].lower()
    words = word_tokenize(corpus[i])
    words = [word for word in words if word not in stop_words]
    corpus[i] = ' '.join(words)

print(corpus)

word2count = {}
for sentence in corpus:
    words = word_tokenize(sentence)
    for word in words:
        if word not in word2count.keys():
            word2count[word] = 1
        else:
            word2count[word] += 1
word2count

import heapq
freq_words = heapq.nlargest(5, word2count, key=word2count.get)
freq_words

X = []
for sentence in corpus:
    vector = []
    for word in freq_words:
        if word in word_tokenize(sentence):
            vector.append(1)
        else:
            vector.append(0)
    X.append(vector)
X = np.asarray(X)
X

"""##3. **Term Frequency-Inverse Document Frequency (TF-IDF)**

1. Term Frequency (TF)
- Measures how frequently a term (word) appears in a document.
- Calculated as:
$$
\text{TF}(t, d) = \frac{\text{Number of times term } t \text{ appears in document } d}{\text{Total number of terms in document } d}
$$

2. Inverse Document Frequency (IDF)
- Measures how important a term is across the corpus.
- Calculated as:
$$
\text{IDF}(t, D) = \log \left( \frac{\text{Total number of documents } |D|}{\text{Number of documents with term } t} \right)
$$
- Where \( |D| \) is the total number of documents in the corpus.

3. TF-IDF Score
- The product of TF and IDF:
$$
\text{TF-IDF}(t, d, D) = \text{TF}(t, d) \times \text{IDF}(t, D)
$$

"""

from sklearn.feature_extraction.text import TfidfVectorizer

corpus = [
    "Cats are great pets",
    "Dogs are Cats are animals",
    "Dogs bring joy to people"
]

vectorizer = TfidfVectorizer()

tfidf_matrix = vectorizer.fit_transform(corpus)

feature_names = vectorizer.get_feature_names_out()

dense_tfidf_matrix = tfidf_matrix.todense()

print("TF-IDF Matrix:")
print(dense_tfidf_matrix)

print("\nFeature Names:")
print(feature_names)

for i, doc in enumerate(dense_tfidf_matrix):
    print(f"\nDocument {i+1} TF-IDF values:")
    for j, value in enumerate(doc.tolist()[0]):
        if value > 0:
            print(f"{feature_names[j]}: {value:.4f}")

